import React from "react";
import styles from "./Ranking.module.css";
import Header from "../components/Home/Header";

const Ranking = () => {
  return (
    <div>
      <Header />

      <div className={styles.RankingHeader}>
        <img />
      </div>
    </div>
  );
};

export default Ranking;
